// src/components/Draft.js

import React, { useState, useEffect } from 'react';
import { useFantasy } from '../context/FantasyContext';
import api from '../services/api';
import './../styles/global.scss';
import './../styles/draft.scss';
import ConfirmationModal from './ui/ConfirmationModal';

export default function DraftScreen() {
  const { players, setPlayers, participants } = useFantasy();
  const [selectedParticipant, setSelectedParticipant] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [selectedPlayer, setSelectedPlayer] = useState(null);
  const [showModal, setShowModal] = useState(false);

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);
        const [playersResponse, picksResponse] = await Promise.all([
          api.fetchPlayers(),
          api.fetchPicks(),
        ]);

        const updatedPlayers = playersResponse.data.map(player => {
          const picked = picksResponse.data.find(pick => pick.player_id === player.id);
          return {
            ...player,
            selected: !!picked,
            selectedBy: picked ? picked.participant_id : null,
          };
        });

        setPlayers(updatedPlayers);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching data:', error);
        setError('Error al cargar los datos. Por favor intenta de nuevo.');
        setLoading(false);
      }
    };

    fetchData();
  }, [setPlayers]);

  const handleSelectPlayer = (player) => {
    if (!selectedParticipant || player.selected) return;
    setSelectedPlayer(player);
    setShowModal(true);
  };

  const confirmPick = async () => {
    if (!selectedPlayer || !selectedParticipant) return;

    try {
      await api.pickPlayer(selectedParticipant, selectedPlayer.id);
      setPlayers(players.map(p => p.id === selectedPlayer.id ? { ...p, selected: true, selectedBy: selectedParticipant } : p));
      setShowModal(false);
      setSelectedPlayer(null);
    } catch (error) {
      console.error("Error selecting player:", error);
      alert('Error selecting player. Please try again.');
      setShowModal(false);
    }
  };

  const closeModal = () => {
    setShowModal(false);
    setSelectedPlayer(null);
  };

  const renderTeams = () => {
    const teams = [...new Set(players.map(player => player.team_name))];

    return (
      <div className="draft-grid">
        {teams.map(team => (
          <div key={team} className="team-section">
            <div className="team-header">{team}</div>
            <div className="team-players">
              {players
                .filter(player => player.team_name === team)
                .map(player => (
                  <div
                    key={player.id}
                    className={`player-card ${player.selected ? 'selected' : 'available'}`}
                    onClick={() => handleSelectPlayer(player)}
                  >
                    <span className="player-name">{player.name}</span>
                    <span className="player-role">{player.role}</span>
                  </div>
                ))}
            </div>
          </div>
        ))}
      </div>
    );
  };

  if (loading) {
    return <div>Cargando datos...</div>;
  }

  if (error) {
    return <div>{error}</div>;
  }

  return (
    <div className="draft-screen">
      <div className="participant-select">
        <select
          value={selectedParticipant || ""}
          onChange={(e) => setSelectedParticipant(e.target.value)}
        >
          <option value="" disabled>Seleccionar participante</option>
          {participants.map(participant => (
            <option key={participant.id} value={participant.id}>
              {participant.name}
            </option>
          ))}
        </select>
      </div>

      {renderTeams()}

      {showModal && (
        <ConfirmationModal
          isOpen={showModal}
          onClose={closeModal}
          onConfirm={confirmPick}
          title="Confirmar Pick"
          message={`¿Estás seguro de que deseas seleccionar a ${selectedPlayer?.name}?`}
        />
      )}
    </div>
  );
}
